description:
Sweet Sinners - Naughty Neighbors (2010)

Middle aged couple Shayla and Jay are suffering from empty nest syndrome since their kids moved away. To spice up their lives, they rent out the back house to an artsy newlywed couple, James and Jandi Lin. But the hot young couple wants more than just a place to stay, and Shayla and Jay are soon in way over their heads. Will Jay be able to resist the advances of hot Asian temptress Jandi? What will Shayla do when young James sets his sights on the sexy older blonde?
Are the young hotties in love with the older couple, or is it all just a sick game? Shayla Laveaux, Jay Crew, James Deen, and Jandi Lin star in this tale of deception, seduction and sizzling hardcore sex.


